import React from 'react';
import { Container, Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const DeliveryInfo = () => {
    return (
        <Container fluid>
            <Container>
                <div className="row p-5">
                    <div className="col-md-8 p-5" style>
                        <img src="https://www.jquery-az.com/wp-content/uploads/2016/08/95.0_1-jquery-map.jpg" alt="" className="w-100 rounded"/>
                    </div>
                    <div className="col-md-4 p-5 bg-light rounded">
                        <div>
                            <img src="https://iili.io/2vJOzb.png" alt="" className="w-100"/>
                        </div>
                    </div>
                </div>
                   
            </Container>
        </Container>
    );
};

export default DeliveryInfo;
